Dragonquest (2009)  

Verenigde Staten
Fantasy
90 minuten

geregisseerd door Mark Atkins
met Marc Singer, Jason Connery en Daniel Bonjour

Een eeuwenoude tovenaar wekt een gigantisch, mythologisch beest tot leven. Een jonge held krijgt de taak om op pad te gaan en een hele reeks opdrachten uit te voeren, om zo een bijzondere draak te ontwaken. Deze draak zou de jonge held dan namelijk kunnen helpen met het verslaan van het gruwelijke monster.

